import '../styles/styles.css'
import Header from '../components/Header'
const App = ({ Component, pageProps }) => {
    return (
    <div>
        <Header/>
        <div className="min-h-screen container mx-auto">
            <Component {...pageProps}></Component>
        </div>
        <div>Footer</div>
    </div>
    )
}

export default App;
